import styled from "styled-components";

const Container = styled.div`
display: flex;
justify-content: center;
align-items: center;
margin: 5px;
width: 40%;
height: 40%;
`;
export default function Card(props) {
  return (
    <Container>
      <br />
      <hr />
      <button
        onClick={() => {
          props.onClose();
        }}
      >
        X
      </button>
      <h2>{props.name}</h2>
      <h2>{props.status}</h2>
      <h2>{props.species}</h2>
      <h2>{props.gender}</h2>
      <h2>{props.origin}</h2>
      <img src={props.image} alt="" />
    </Container>
  );
}
